import React from 'react';
import logo from './logo.svg';
import './App.css';
let count = 0;
const element = <h1>{count}</h1>;


function plusCount (){
  console.log(count = count + 1);
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <section class="couner-container">
          {count}
          <div>
          <button onClick={plusCount} >+</button>
          <button>-</button>
        </div>
        </section>
      </header>
    </div>
  );
}

export default App;
